    // </div>
    <div className="App">
    <Router>
      <Header />
      <main>
        <Routes>
          <Route path="/" element={<Home />} />
          <Route path="/about" element={<About />} />
          <Route path="/specialties" element={<Specialties />} />
          <Route path="/gallery" element={<Gallery />} />
          <Route path="/contact" element={<Contact />} />
          <Route path="/service" element={<Service />} />
      </Routes>
      </main>

    <Footer />
  </Router>
  </div>
  );
}

export default App;
